								<p>Central Amenities</p>
								<h2 class="font-bold">The Ground<br />Floor Cafeteria</h2>
								<p class="font-bold">Welcome to BLR37s cafeteria! Two floors, one connected experience.</p>
								<p>
									With ~1,250 seats, a central staircase tying it all together, and spaces designed around every Amazonians needs, the BLR37 cafeteria is where you refuel, recharge, and reconnect.
								</p>
								<p>
									<span class="bold">Fruit it Up</span> - Fresh juices & cut fruits
									<br />Open 24/7
								</p>
								<p>
									<span class="bold">Bread & Crumbs</span> - Maggi, sandwiches, salads & soups
									<br />8:00 AM - 11:00 PM
								</p>
								<p class="bold">The World Plate</p>
								<ul>
									<li>
										Continental dishes - Open 24/7
									</li>
									<li>
										Made-to-order eggs - Open 24/7
									</li>
									<li>
										Asian bowls - 12:00 PM - 11:00 PM
									</li>
								</ul>
								<p class="bold">
									Food Quest
								</p>
								<u>
									<li><span class="bold">Gopal Ji</span> - Chaats & Indian sweets  8:00 AM  8:00 PM</li>
									<li><span class="bold">Domino's</span> - comfort pizza 11:00 AM  11:00 PM</li>
								</u>
								<p class="font-bold">Torte Corner</p>
								<ul>
									<li>
										<span class="bold">Daily Bake House</span> - Fresh bakes  9:00 AM  8:00 PM
									</li>
									<li>
										<span class="bold">Zomos</span> - Dimsums  12:00 PM  11:00 PM
									</li>
								</ul>
								<p>
									Do check out the Cafeteria on the first floor for more info
								</p>
